import React from 'react';
type TodoPorps = {
  form: string;
  todo: string;
}
const Todo: React.FC<TodoPorps> = ({form, todo}) => {
  return(
    <main className='todo-list'>
      <div className='title'>
      '오늘 할 일'
      </div>
      <section className='forms'>
      {form}
      </section>

      <section className='todos'>
      {todo}
      </section>
    </main>
  )
};

export default Todo;
